import React from "react";
import { HashRouter, Route, Link, Switch } from "react-router-dom";
import Main from "../components/Main";

const App = () => (
  <div>
    <HashRouter>
      <Navigation />
      <Switch>
        <Route exact path="/" component={Main} />
        <Route path="/done" component={HelloYou} />
        <Route path="/not-done" component={CheckAge} />
      </Switch>
    </HashRouter>
  </div>
);

export default App;
